import React, { Component } from 'react'
import fac from '../components/facebook.png'
import yout from '../components/youtube.png'
import inst from '../components/instagram.png'
import CardSocialitems from './CardSocialitems'

export default class Carditems extends Component {
  render() {
    return (
      <div className=''>
          <div className='card'>
              <img className='card-img-top rounded-circle' src={this.props.pr.profileImg} alt=''/>
              <div className='card-body'>
                  <h5 className='card-title'>{this.props.pr.title}</h5>
                  <p>Tel: {this.props.pr.tel}</p>
                  <p>Email: {this.props.pr.email}</p>
                  <p>WebSite: <a href={this.props.pr.name}>{this.props.pr.web}</a></p>
                  <div className='listsocial'>
                    <CardSocialitems p = {{
                        img: fac,
                        text: "facebook",
                    }} />
                    <CardSocialitems p = {{
                        img: yout,
                        text: "youtube"
                    }} />
                    <CardSocialitems p = {{
                        img: inst,
                        text: "instagram",
                    }} />
                  </div>
              </div>
        </div>
      </div>
    )
  }
}
